import React from "react";
import impressionIcon from "../images/impressionIcon.png";

function TrendingQuizBox() {
  return (
    <div
      style={{
        height: "10vh",
        width: "14vw",
        backgroundColor: "white",
        marginLeft: "3vw",
        marginTop: "3vh",
        borderRadius: "5px",
        fontWeight: "600",
      }}
    >
      <p style={{ color: "#474444", fontSize: "1.4em", marginTop: "1vh" }}>
        Quiz 1<span style={{ color: "#FF5D01", fontSize: "1.2em" }}>667</span>
        <img src={impressionIcon} alt="impressionIcon" />
      </p>
      <p style={{ color: "#60B84B", fontSize: "1em" }}>
        Created on : 04 Sep, 2023
      </p>
    </div>
  );
}

export default TrendingQuizBox;
